import React from 'react';
import PaymentClass from '../PaymentClass';

function Payment({}) {
    const payment = new PaymentClass(friend,cost,reason);
    return (
      <p>{payment.friend} paid {payment.cost} for {payment.reason}</p>
    )
  }
function ListPayment({listPayment}) {
  return (
      <>
          {listPayment.map((payment, index)=> {
              return <Payment friend={payment.friend} cost={payment.cost} reason={payment.reason} key={index} />
          })}
      </>
)};



export default ListPayment;
